import axios from 'axios';



const useStyles = makeStyles((theme) => ({
  left_session:{
    padding:theme.spacing(2),
    maxWidth:"100%"

  }
 
}));

export default function SearchAppBar() {
  const classes = useStyles();

  const [type, setType] = useState("");
  console.log("123",type)

  useEffect(() => {
    category()
  })
// category get
const category =()=>{
  axios.get(`http://localhost:8081`)
  .then(res => {
       console.log("res",res)
    setType(res.data)
  })
  .catch(err=> {
    console.log("error")

  })

}


  return (
    <div className={classes.root}>


      <Grid container spacing={0}>
      <Grid item xs={12} sm={12} md={12} lg={12}>
      <Typography className={classes.header} variant="h4" noWrap>
            RESTAURANT IN INDIA <span className={classes.header1}>/TOTAL RESTAURANT</span>  
          </Typography>
        </Grid>
 
 {/* left side session */}
        <Grid item xs={6} sm={6} md={6} lg={3}>
        <Grid item xs={6} sm={6} md={6} lg={3} className={classes.left_session}>
          <Typography>category</Typography>
                  {/* {type.length >0 && type.map((item,index) => (
                            <FormControlLabel
                         control={
                        <Checkbox
                       icon={<CheckBoxOutlineBlankIcon fontSize="small" />}
                       checkedIcon={<CheckBoxIcon fontSize="small" />}
                        name={item.id}
                        checked={item.status}
                        onChange={(e) => chkhandleChange("Status",e,index,item)}
                               />
                           }
                           label={item.category_name}
                           />
                           ))} */}

                   
        <FormGroup>
        <FormControlLabel
            control={<Checkbox   name="gilad" />}
            label="All"
          />
             <Divider variant="middle" />
          <FormControlLabel
            control={<Checkbox   name="gilad" />}
            label="Gilad Gray"
          />
             <Divider variant="middle" />
          <FormControlLabel
            control={<Checkbox   name="jason" />}
            label="Jason Killian"
          />
             <Divider variant="middle" />
          <FormControlLabel
            control={<Checkbox   name="antoine" />}
            label="Antoine Llorca"
          />
             <Divider variant="middle" />
        </FormGroup>


        <Typography></Typography>
        <FormGroup>
        <FormControlLabel
            control={<Checkbox   name="gilad" />}
            label="All"
          />
             <Divider variant="middle" />
          <FormControlLabel
            control={<Checkbox   name="gilad" />}
            label="Gilad Gray"
          />
             <Divider variant="middle" />
          <FormControlLabel
            control={<Checkbox   name="jason" />}
            label="Jason Killian"
          />
             <Divider variant="middle" />
          <FormControlLabel
            control={<Checkbox   name="antoine" />}
            label="Antoine Llorca"
          />
             <Divider variant="middle" />
        </FormGroup>
        </Grid>

     
        </Grid>
        <Grid item xs={6} sm={6} md={6} lg={9}>
        hello
        </Grid>
 
      </Grid>
    </div>
  );
}
